import React from 'react';
import { MovieFilters } from '/domain/input/buttons/filterButtonGroups/mediaFilters/movieFilters';
import { MovieSetFilters } from '/domain/input/buttons/filterButtonGroups/mediaFilters/movieSetFilter';
import { MovieFormatFilter } from '/domain/input/buttons/filterButtonGroups/mediaFilters/movieFormatFilter';

export const AllMovieFilters = props => {
    return (
        <>
            <MovieFilters handleFilterChangeByMovie={props.handleFilterChangeByMovie}/>
            <MovieFormatFilter  handleFilterChangeByFormat={props.handleFilterChangeByFormat} />
            <MovieSetFilters handleFilterChangeByMovieSet={props.handleFilterChangeByMovieSet} />
        </>

    );
};
